      "name": "TzKT Events",
      "description": "TzKT Events is a WebSocket API based on [SignalR](https://docs.microsoft.com/aspnet/signalr/overview/getting-started/introduction-to-signalr)\nthat enables receiving data from the Tezos blockchain in real-time.\n\nThis is a very useful feature, especially when you need to receive updates immediately, as soon as they appear on the node and are indexed by the indexer.\nAlso it allows to significantly simplify client's logic responsible for updating/synchronizing data.\n\nEvents base URL: `https://{baseUrl}/v1/events`\n\n## Message types\n\nAfter connecting to the WebSocket and subscribing to some events the client starts receiving messages from the server.\nThere are three message types that the server sends to the client:\n\n#### 1. State message\n\n````js\n{\n\ttype: 0,    // 0 - state message\n\tstate: 0    // subscription state\n}\n````\n\nThis is the very first message the client receives from the server after opening a subscription. \nThis message is a kind of confirmation that the subscription has been successfully processed.\n\nThere is just one meaningful field - `state`, that represents current state of the subscription.\nThe type of that field depends on a particular subscription (see documentation on each subscription).\nFor example, if you subscribe to new blocks, the `state` will contain a level of the last sent block.\nSo if you receive a state message with `state: 1300123`, the next block you may expect to receive will be `1300124`.\n\nState can be used to fetch historical data from the REST API right after opening a subscription, so that there will be no nor misses nor duplicates.\n\n#### 2. Data message\t  \n\n````js\n{\n\ttype: 1,    // 1 - data message\n\tstate: 0,   // subscription state\n\tdata: {}    // data: object or array, depending on subscription\n}\n````\n\nAfter subscription is registered and state message is received, client will receive data messages. As you can see, `data` is an array (array of\nblocks, operations, or whatever you have subscribed to), that means you may receive multiple items in a single message,\nwhich is great for performance and network traffic.\n\nTzKT Events operates with the same data models as the REST API to achieve full compatibility and data consistency.\n\n#### 3. Reorg message\t\n\n````js\n{\t\t\t  \n\ttype: 2,    // 2 - reorg message\n\tstate: 0    // subscription state\n}\n````\n\nReorg messages signal about chain reorganizations, when some blocks, including all operations, are rolled back\nin favor of blocks with higher weight.  Chain reorgs happen quite often, so it's not something you can ignore.\nYou have to handle such messages correctly, otherwise you will likely accumulate duplicate data or, worse, invalid data.\n\nFor example, if you receive blocks `10`, `11`, `12`, `13` and then receive reorg message with `state: 11`,\nyou should remove blocks `12` and `13` (if you saved them) as they are no longer valid."
    },
    {
      "name": "Subscriptions",
      "description": "## SubscribeToHead\n\nSends the blockchain head every time it is changed.\n\t\t\n### Method \n\n`SubscribeToHead`\n\n### Channel \n\n`head`\n\n### Parameters\n\nNo parameters.\n\n### Data model\n\nSame as in [/head](#tag/Head)\n\n### State\n\nState contains level (`int`) of the last processed head.\n\n### Example\n\n````js\nconnection.on(\"head\", (msg) => { console.log(msg); });\nawait connection.invoke(\"SubscribeToHead\");\n````\n\n---\n\n## SubscribeToBlocks  \n\nSends blocks added to the blockchain\n\t\t\n### Method \n\n`SubscribeToBlocks`\n\n### Channel \n\n`blocks`\n\n### Parameters\n\nNo parameters.\n\n### Data model\n\nSame as in [/blocks](#operation/Blocks_GetHead)\n\n### State\n\nState contains level (`int`) of the last processed block.\n\n### Example\n\n````js\nconnection.on(\"blocks\", (msg) => { console.log(msg); });\nawait connection.invoke(\"SubscribeToBlocks\");\n````\n\n---\n\n## SubscribeToAccount\n\nSends touched accounts (affected by any operation in any way).\n\n### Method\n\n`SubscribeToAccounts`\n\n### Channel\n\n`accounts`\n\n### Parameters\n\n````js\n{\n\taddresses: [], // [required] array of address you want to subscribe to\n}\n````\n\n> **Note:** you can invoke this method multiple times with different parameters to register multiple subscriptions.\n\n### Data model\n\nSame as in [/accounts/{address}](#operation/Accounts_GetByAddress).\n\n### State\n\nState contains level (`int`) of the last processed block.\n\n### Example\n\n````js\nconnection.on(\"accounts\", (msg) => { console.log(msg); });\n// subscribe to an account\nawait connection.invoke(\"SubscribeToAccounts\", { addresses: [ 'tz1234...' ] });\n````\n\n---\t\t\t\n\n## SubscribeToOperations \n\t\t\t\t\t\t\t\t\t\t\t\t\t\t  \nSends operations of specified types or related to specified accounts, included into the blockchain\n\t\t\n### Method \n\n`SubscribeToOperations`\n\n### Channel \n\n`operations`\n\n### Parameters\n\n````js\n{\n\taddress: '', // address you want to subscribe to,\n\t             // or null if you want to subscribe for all operations\n\n\ttypes: ''    // comma-separated list of operation types, any of:\n\t             // 'transaction', 'origination', 'delegation', 'reveal'\n\t\t\t\t // 'double_baking', 'double_endorsing', 'nonce_revelation', 'activation'\n\t\t\t\t // 'proposal', 'ballot', 'endorsement.\n}\n````\n\t\t\t\t\t\t\t\t\t\t\t\t\t\t\t\t\t \n> **Note:** you can invoke this method multiple times with different parameters to register multiple subscriptions.\n\n### Data model\n\nSame as in [/operations/transactions](#operation/Operations_GetTransactions), [/operations/delegations](#operation/Operations_GetDelegations), etc.\n\n### State\n\nState contains level (`int`) of the last processed block.\n\n### Example\n\n````js\nconnection.on(\"operations\", (msg) => { console.log(msg); });\n// subscribe to all transactions\nawait connection.invoke(\"SubscribeToOperations\", { types: 'transaction' });\n// subscribe to all delegations and originations related to the address 'tz1234...'\nawait connection.invoke(\"SubscribeToOperations\", { address: 'tz1234...', types: 'delegation,origination' });\n````\n\n---\t\t\t\n\n## SubscribeToBigMaps \n\t\t\t\t\t\t\t\t\t\t\t\t\t\t  \nSends bigmap updates\n\t\t\n### Method \n\n`SubscribeToBigMaps`\n\n### Channel \n\n`bigmaps`\n\n### Parameters\n\nThis method accepts the following parameters:\n\n````js\n{\n\tptr: 0,         // ptr of the bigmap you want to subscribe to\n\ttags: [],       // array of bigmap tags ('metadata' or 'token_metadata')\n\tcontract: '',   // contract address\n\tpath: ''        // path to the bigmap in the contract strage\n}\n````\n\nYou can set various combinations of these fields to configure what you want to subscribe to. For example:\n\n````js\n// subscribe to all bigmaps\n{\n}\t \n\n// subscribe to all bigmaps with specific tags\n{\t\t\n\ttags: ['metadata', 'token_metadata']\n}\n\n// subscribe  to all bigmaps of the specific contract\n{\n\tcontract: 'KT1...'\n}\n\n// subscribe to all bigmaps of the specific contract with specific tags\n{\n\tcontract: 'KT1...',\n\ttags: ['metadata']\n}\n\n// subscribe to specific bigmap by ptr\n{\n\tptr: 123\n}\n\t\n// subscribe to specific bigmap by path\n{\n\tcontract: 'KT1...',\n\tpath: 'ledger'\n}\n````\n\n> **Note:** you can invoke this method multiple times with different parameters to register multiple subscriptions.\n\n### Data model\n\nSame as in [/bigmaps/updates](#operation/BigMaps_GetBigMapUpdates).\n\n### State\n\nState contains level (`int`) of the last processed block.\n\n### Example\n\n````js\nconnection.on(\"bigmaps\", (msg) => { console.log(msg); });\n// subscribe to all bigmaps of the 'KT123...' contract\nawait connection.invoke(\"SubscribeToBigMaps\", { contract: 'KT123...' });\n// subscribe to bigmap with ptr 123\nawait connection.invoke(\"SubscribeToBigMaps\", { ptr: 123 });\n````\n\n---"
    },
